"use client";

import { useState, useEffect } from "react";
import { addSale, getUserData } from "@/services/firebaseService";
import { jsPDF } from "jspdf";

export default function QuickSale() {
  const [product, setProduct] = useState("");
  const [quantity, setQuantity] = useState(1);
  const [price, setPrice] = useState("");
  const [cash, setCash] = useState("");
  const [change, setChange] = useState(0);
  const [success, setSuccess] = useState(false);
  const [saleNumber, setSaleNumber] = useState(Date.now());
  const [userName, setUserName] = useState(""); // Nombre del usuario

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const userData = await getUserData();
        setUserName(`${userData.firstName} ${userData.lastName}`);
      } catch (error) {
        console.error("Error al obtener los datos del usuario:", error);
      }
    };

    fetchUserData();
  }, []);

  const handleCalculateChange = () => {
    const total = parseFloat(price || 0) * parseInt(quantity || 1);
    setChange((parseFloat(cash || 0) - total).toFixed(2));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSuccess(false);

    const total = parseFloat(price || 0) * parseInt(quantity || 1);

    try {
      // Registrar la venta en Firestore
      await addSale({
        product,
        quantity: parseInt(quantity),
        price: parseFloat(price),
        total,
        date: new Date().toISOString(),
        type: "quick-sale",
        saleNumber,
      });

      // Generar la boleta en PDF
      generateReceipt(product, quantity, price, total, cash, change, saleNumber);

      setSuccess(true);
      setProduct("");
      setQuantity(1);
      setPrice("");
      setCash("");
      setChange(0);
      setSaleNumber(Date.now());
    } catch (error) {
      console.error("Error al registrar la venta rápida:", error);
    }
  };

  const generateReceipt = (product, quantity, price, total, cash, change, saleNumber) => {
    const doc = new jsPDF();

    // Usa una imagen base64 válida o una URL válida
    const logoBase64 = "data:image/jpeg;base64,"; // Reemplaza con tu imagen base64 válida
    // const logoUrl = "https://example.com/logo.png"; // Alternativamente, usa una URL válida

    try {
      // Agregar el logo
      doc.addImage(logoBase64, "PNG", 10, 10, 30, 30);
    } catch (error) {
      console.error("Error al agregar el logo al PDF:", error);
    }

    // Información de la boleta
    doc.setFontSize(16);
    doc.text("Boleta de Venta Rápida", 50, 20);
    doc.setFontSize(12);
    doc.text(`Número de Venta: ${saleNumber}`, 10, 50);
    doc.text(`Fecha: ${new Date().toLocaleDateString()}`, 10, 60);
    doc.text(`Producto: ${product}`, 10, 70);
    doc.text(`Cantidad: ${quantity}`, 10, 80);
    doc.text(`Precio Unitario: $${parseFloat(price).toFixed(2)}`, 10, 90);
    doc.text(`Total: $${total.toFixed(2)}`, 10, 100);
    doc.text(`Efectivo Recibido: $${parseFloat(cash).toFixed(2)}`, 10, 110);
    doc.text(`Cambio: $${change}`, 10, 120);
    doc.text("Gracias por su compra", 10, 140);

    // Guardar el PDF
    doc.save(`boleta_venta_rapida_${saleNumber}.pdf`);
  };

  return (
    <div className="p-8 text-black">
      <h1 className="text-3xl font-bold mb-6">Venta Rápida</h1>
      {success && (
        <p className="text-green-500 mb-4">¡Venta rápida registrada exitosamente!</p>
      )}
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded-lg shadow-md">
        <div className="mb-4">
          <label className="block text-gray-700 font-semibold mb-2">
            Producto
          </label>
          <input
            type="text"
            value={product}
            onChange={(e) => setProduct(e.target.value)}
            className="w-full p-3 border border-gray-300 rounded-lg"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-semibold mb-2">
            Cantidad
          </label>
          <input
            type="number"
            value={quantity}
            onChange={(e) => setQuantity(e.target.value || 1)}
            className="w-full p-3 border border-gray-300 rounded-lg"
            min="1"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-semibold mb-2">
            Precio Unitario
          </label>
          <input
            type="number"
            value={price}
            onChange={(e) => setPrice(e.target.value || "")}
            className="w-full p-3 border border-gray-300 rounded-lg"
            step="0.01"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-semibold mb-2">
            Efectivo Recibido
          </label>
          <input
            type="number"
            value={cash}
            onChange={(e) => setCash(e.target.value || "")}
            onBlur={handleCalculateChange}
            className="w-full p-3 border border-gray-300 rounded-lg"
            step="0.01"
            required
          />
        </div>
        <div className="mb-4">
          <label className="block text-gray-700 font-semibold mb-2">
            Cambio
          </label>
          <input
            type="text"
            value={change}
            readOnly
            className="w-full p-3 border border-gray-300 rounded-lg bg-gray-100"
          />
        </div>
        <button
          type="submit"
          className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700"
        >
          Registrar Venta Rápida
        </button>
      </form>
    </div>
  );
}
